}},"id":"1256","type":"VBar"},{"attributes":{},"id":"1123","type":"UnionRenderers"},{"attributes":{"bottom":{"field":"140117643987168close"},"fill_color":{"field":"140117643987168colors_bars"},"line_color":{"field":"140117643987168colors_outline"},"top":{"field":"140117643987168open"},"width":{"value":0.5},"x":{"field":"index"}},"id":"1255","type":"VBar"},{"attributes":{"format":"0,0.000"},"id":"1269","type":"NumeralTickFormatter"},{"attributes":{"data_source":{"id":"1199"},"glyph":{"id":"1255"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1256"},"selection_glyph":null,"view":{"id":"1258"}},"id":"1257","type":"GlyphRenderer"},{"attributes":{},"id":"1573","type":"UnionRenderers"},{"attributes":{},"id":"1574","type":"StringEditor"},{"attributes":{},"id":"1575","type":"StringEditor"},{"attributes":{"children":[{"id":"1579"}],"sizing_mode":"stretch_width"},"id":"1581","type":"Row"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1438","type":"BoxAnnotation"},{"attributes":{"sizing_mode":"scale_both","text":"class TestStrategy(bt.Strategy):\n    params = (('p1', 8), \n    ('p2', 21),\n    ('p3', 55),\n    ('p4', 144),\n    ('rsi', 40),\n    ('rr', 2),\n    ('rrp', 1),\n    ('candleper', 0.005),\n    ('delay', -1),\n    ('pricelimitper', 0.001),\n    ('bodyper', 0.7),\n    )\n    \n\n    def log(self, txt, dt=None):\n        ''' Logging function fot this strategy'''\n        dt = dt or self.datas[0].datetime.date(0)\n        #print('%s, %s' % (dt.isoformat(), txt))\n        print('%s,%s, %s' % (dt.strftime(\"%d/%m/%Y\"),self.datas[0].datetime.time().strftime(\"%H:%M:%S\") ,txt))\n\n    def __init__(self):\n        # Keep a reference to the \"close\" line in the data[0] dataseries\n        self.dataclose = self.datas[0].close\n        self.dataopen = self.datas[0].open\n        self.datalow = self.datas[0].low\n        self.datahigh = self.datas[0].high\n        \n\n        # To keep track of pending orders and buy price/commission\n        self.order = None\n        self.buyprice = None\n        self.buycomm = None\n        self.sl = 1\n        self.reward = 0\n        \n\n        # Add a MovingAverageSimple indicator\n        self.sma1 = bt.indicators.EMA(period=self.p.p1)\n        self.sma2 = bt.indicators.EMA(period=self.p.p2)\n        self.sma3 = bt.indicators.EMA(period=self.p.p3)\n        self.sma4 = bt.indicators.EMA(period=self.p.p4)\n        self.rsi = bt.indicators.RSI(self.datas[0],plothlines=[55, 45])\n        #self.vwap = bt.indicators.VWAP(self.datas[0])\n\n    def notify_order(self, order):\n        if order.status in [order.Submitted, order.Accepted]:\n            # Buy/Sell order submitted/accepted to/by broker - Nothing to do\n            return\n\n        # Check if an order has been completed\n        # Attention: broker could reject order if not enough cash\n        if order.status in [order.Completed]:\n            if order.isbuy():\n                self.log(\n                    'BUY EXECUTED, Price: %.2f, Cost: %.2f, Comm %.2f, candle_pos = %.2f,' %\n                    (order.executed.price,\n                     order.executed.value,\n                     order.executed.comm,\n                     len(self)))\n\n                self.buyprice = order.executed.price\n                self.buycomm = order.executed.comm\n            else:  # Sell\n                self.log('SELL EXECUTED, Price: %.2f, Cost: %.2f, Comm %.2f  candle_pos =%.2f,' %\n                         (order.executed.price,\n                          order.executed.value,\n                          order.executed.comm,\n                          len(self)))\n\n            self.bar_executed = len(self)\n\n        elif order.status in [order.Canceled, order.Margin, order.Rejected]:\n            self.log('Order Canceled/Margin/Rejected')\n\n        self.order = None\n\n    def notify_trade(self, trade):\n        if not trade.isclosed:\n            return\n\n        self.log('OPERATION PROFIT, GROSS %.2f, NET %.2f \\n \\n' %\n                 (trade.pnl, trade.pnlcomm))\n        \n\n\n    def next(self):\n        # Simply log the closing price of the series from the reference\n        #self.log('Close, %.2f' % self.dataclose[0])\n        # Check if time is greater 9 30 or not\n        \n        if (self.data.datetime.time() &lt; datetime.time(9,30) ) or (self.data.datetime.time() &gt; datetime.time(15,10)) :\n                return \n\n        # Check if an order is pending ... if yes, we cannot send a 2nd one\n        if self.order:\n            return\n        \n\n            # Check if we are in the market\n        if self.position.size == 0:\n            \n            # Not yet ... we MIGHT BUY if ... self.datas[0].close\n            c1 = (self.dataclose[self.p.delay] &gt; self.dataopen[self.p.delay]) # Green Candle \n            c2 = (self.rsi[self.p.delay] &gt;= self.p.rsi)  # RSI&gt;55 \n            c3 = (self.dataclose[self.p.delay] &gt; self.sma1[self.p.delay]) &amp; (self.dataclose[self.p.delay] &gt; self.sma2[self.p.delay]) # Close above EMA1  and 2\n            c4 = (self.datalow[self.p.delay] &lt; self.sma1[self.p.delay]) &amp; (self.datalow[self.p.delay] &lt; self.sma2[self.p.delay])  #low below 9 and 21 ema\n            c5 = ((self.datahigh[self.p.delay]-self.datalow[self.p.delay]) &lt; self.p.candleper * self.dataclose[self.p.delay]) #  hi-low &lt; 0.5% of close\n            c6 = self.dataclose[self.p.delay] &gt; self.sma3[self.p.delay]\n            c7 = self.dataclose[self.p.delay] &gt; self.sma4[self.p.delay]\n            #c8 = self.dataclose[0] &gt; self.vwap[0]\n            c9 = (self.dataclose[self.p.delay]-self.dataopen[self.p.delay]) &gt; self.p.bodyper * (self.datahigh[self.p.delay] - self.datalow[self.p.delay])\n            testcandle = 3110\n            if(len(self) == testcandle):\n                self.log(\"Entering candle no \" + str(testcandle))\n                                                                                                                         \n            if (c1 &amp; c2 &amp; c3 &amp; c4 &amp; c5 &amp; c9):\n                ##diff = self.dataclose[0] - self.dataclose[lastred]\n                rr = self.p.rr\n                if(c6):\n                    rr += self.p.rrp\n                if( c7 ):\n                    rr += self.p.rrp\n                # if( c8 ):\n                #     rr+=1\n                #rr =2 \n                cash = self.stats.broker.cash[self.p.delay]\n                maxRisk = cash * 0.01\n                diff = abs(2*(self.datahigh[self.p.delay]-self.datalow[self.p.delay]))\n                self.sl = self.dataclose[self.p.delay] - diff\n                self.reward = rr*diff+self.dataclose[self.p.delay]\n                self.bsize = int(min(maxRisk/diff , cash/self.dataclose[self.p.delay]))\n                # BUY, BUY, BUY!!! (with all possible default parameters)\n                bprice = self.data.close[self.p.delay] * (1+self.p.pricelimitper)\n                self.log(\" Buy Signal at candle_pos = \"+str(len(self))+ \" Buy limit at \"+ str(bprice))\n\n                \n\n                # Keep track of the created order to avoid a 2nd order\n                #self.order = self.buy(size=self.bsize)\n                \n                self.order = self.buy(exectype=bt.Order.Stop,\n                size=self.bsize,price=bprice,\n                valid=datetime.datetime.now() + datetime.timedelta(minutes=30)\n                )\n\n                self.log('BUY CREATE, %.2f' % self.dataclose[self.p.delay])\n\n        else:\n            # Already in a position? check exit criteria\n\n            # Long Eixt criteria\n            e1 = (self.dataclose[0] &lt; self.sl) # SL reached\n            e2 = (self.dataclose[0] &gt; self.reward) # Reward reached\n            e3 = (self.dataopen[0] &gt; self.reward)  # Reward reached \n\n            if (e1 | e2 | e3):\n                # SELL, SELL, SELL!!! (with all possible default parameters)\n                self.log('SELL CREATE... closed position, %.2f ' % self.dataclose[0])\n\n                # Keep track of the created order to avoid a 2nd order\n                self.order = self.sell(size=self.bsize)\n        #printf(f) Close all positions EOD\n        if self.position.size != 0:\n            if self.data.datetime.time() &gt; datetime.time(15,10):\n                    self.close(exectype=bt.Order.Market,size=self.position.size)\n"},"id":"1730","type":"PreText"},{"attributes":{"data":{"col0":["p1","p2","p3","p4","rsi","rr","rrp","candleper","delay","pricelimitper","bodyper"],"col1":["8","21","55","144","40","2","1","0.01","-1","0.00","0.70"]},"selected":{"id":"1655"},"selection_policy":{"id":"1656"}},"id":"1587","type":"ColumnDataSource"},{"attributes":{"child":{"id":"1582"},"title":"Analyzers"},"id":"1583","type":"Panel"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"1434"},{"id":"1435"},{"id":"1436"},{"id":"1437"},{"id":"1449"},{"id":"1482"}]},"id":"1439","type":"Toolbar"},{"attributes":{"css_classes":["panel-title"],"sizing_mode":"scale_both","text":"Source Code"},"id":"1729","type":"Paragraph"},{"attributes":{"css_classes":["table-title"],"text":"Strategy: TestStrategy"},"id":"1586","type":"Paragraph"},{"attributes":{"children":[{"id":"1586"},{"id":"1590"},{"id":"1592"},{"id":"1596"},{"id":"1598"},{"id":"1602"},{"id":"1604"},{"id":"1608"},{"id":"1610"},{"id":"1614"}],"sizing_mode":"stretch_width"},"id":"1616","type":"Column"},{"attributes":{"args":{"axis":{"id":"1426"},"formatter":{"id":"1446"},"source":{"id":"1002"}},"code":"// args: axis, formatter, source\n// We override this axis' formatter's `doFormat` method\n// with one that maps index ticks to dates. Some of those dates\n// are undefined (e.g. those whose ticks fall out of defined data\n// range) and we must filter out and account for those, otherwise\n// the formatter computes invalid visible span and returns some\n// labels as 'ERR'.\n// Note, after this assignment statement, on next plot redrawing,\n// our override `doFormat` will be called directly\n// -- FunctionTickFormatter.doFormat(), i.e. _this_ code, no longer\n// executes.\n\naxis.formatter.doFormat = function (ticks) {\n    const dates = ticks.map(i =&gt; source.data.datetime[source.data.index.indexOf(i)]),\n        valid = t =&gt; t !== undefined,\n        labels = formatter.doFormat(dates.filter(valid));\n    let i = 0;\n    return dates.map(t =&gt; valid(t) ? labels[i++] : '');\n};\n\n// we do this manually only for the first time we are called\nconst labels = axis.formatter.doFormat(ticks);\nreturn labels[index];\n"},"id":"1447","type":"FuncTickFormatter"},{"attributes":{"days":["%d %b %R"],"hourmin":["%H:%M:%S"],"hours":["%d %b %R"],"minsec":["%H:%M:%S"],"minutes":["%H:%M"],"months":["%d/%m/%y"],"seconds":["%H:%M:%S"],"years":["%Y %b"]},"id":"1446","type":"DatetimeTickFormatter"},{"attributes":{"columns":[{"id":"1588"},{"id":"1589"}],"height":300,"index_position":null,"sizing_mode":"stretch_width","source":{"id":"1587"},"view":{"id":"1591"},"width":0},"id":"1590","type":"DataTable"},{"attributes":{"editor":{"id":"1658"},"field":"col0","formatter":{"id":"1657"},"title":"Name"},"id":"1588","type":"TableColumn"},{"attributes":{"editor":{"id":"1660"},"field":"col1","formatter":{"id":"1659"},"title":"Value"},"id":"1589","type":"TableColumn"},{"attributes":{"css_classes":["table-title"],"text":"Observer: Trades - Net Profit/Loss"},"id":"1598","type":"Paragraph"},{"attributes":{"source":{"id":"1587"}},"id":"1591","type":"CDSView"},{"attributes":{"source":{"id":"1593"}},"id":"1597","type":"CDSView"},{"attributes":{"data_source":{"id":"1416"},"glyph":{"id":"1455"},"hover_glyph":null,"level":"underlay","muted_glyph":null,"name":"rsiline","nonselection_glyph
